import React from 'react';
import { Box, Container, Typography, Button } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';
import AuthForm from '../components/AuthForm';
import '../styles/neumorphic.css';

const Register = () => {
  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
        minHeight: '100vh',
        backgroundColor: 'background.default',
        alignItems: 'center',
        justifyContent: 'center',
      }}
    >
      <Container maxWidth="sm" className="neumorphic-container">
        <div className="neumorphic-card" style={{ width: '100%', padding: '32px' }}>
          <Typography component="h1" variant="h4" gutterBottom>
            Create Account
          </Typography>
          <Typography variant="body2" color="textSecondary" align="center" sx={{ mb: 3 }}>
            Register for secure multi-factor biometric authentication
          </Typography>

          <AuthForm isRegister={true} />

          <Box sx={{ mt: 3 }}>
            <Typography variant="body2" align="center">
              Already have an account?{' '}
              <Button component={RouterLink} to="/login" variant="text" size="small" sx={{ color: 'var(--accent-color)' }}>
                Sign in
              </Button>
            </Typography>
          </Box>
        </div>
      </Container>
    </Box>
  );
};

export default Register;
